CREATE TABLE `_temp` (
  `entry` mediumint(8) unsigned NOT NULL default '0',
  `equipment_id` mediumint(8) unsigned NOT NULL default '0',
  PRIMARY KEY  (`entry`,`equipment_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
